import React, { useState } from "react";
import { 
  Dialog, DialogTitle, DialogContent, DialogActions, Button, TextField, MenuItem, IconButton, Snackbar, Alert 
} from "@mui/material";
import CloseIcon from "@mui/icons-material/Close";
import axios from "axios";
import { useHistory } from "react-router-dom"; // ✅ Use useHistory instead of useNavigate

const API_BASE_URL = process.env.REACT_APP_API_BASE_URL || "http://localhost:8080/api";


const Register = ({ open, onClose }) => {
  const history = useHistory(); // ✅ Use useHistory for navigation
  const initialFormState = {
    username: "",
    password: "",
    role: "BUYER",
  };

  // const [formData, setFormData] = useState(initialFormState);
  const [loading, setLoading] = useState(false);
  const [message, setMessage] = useState({ text: "", type: "success" });
  const [snackbarOpen, setSnackbarOpen] = useState(false);
  const [formData, setFormData] = useState({ password: "" });
const [passwordError, setPasswordError] = useState("");


  // Handle input changes
  const validatePassword = (password) => {
  // At least one letter, one number, and one special character
  const regex = /^(?=.*[A-Za-z])(?=.*\d)(?=.*[@$!%*?&])[A-Za-z\d@$!%*?&]{6,}$/;
  return regex.test(password);
};


  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
    const { name, value } = e.target;
  setFormData((prev) => ({ ...prev, [name]: value }));

  if (name === "password") {
    if (!validatePassword(value)) {
      setPasswordError("❌ Password must include letters, numbers, and special characters.");
    } else {
      setPasswordError("");
    }
  }
  };

  // Handle form submission
  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);

    if (!formData.username || !formData.password) {
      setMessage({ text: "❌ All fields are required!", type: "error" });
      setSnackbarOpen(true);
      setLoading(false);
      return;
    }

    try {
      await axios.post(`${API_BASE_URL}/users/register`, formData);
      setMessage({ text: "✅ Registration successful! Redirecting to login...", type: "success" });
      setSnackbarOpen(true);
      setTimeout(() => {
        history.push("/login"); // ✅ Use history.push instead of navigate
      }, 2000);
    } catch (error) {
      console.error("Registration error:", error);
      setMessage({ 
        text: error.response?.data?.message || "❌ Registration failed. Try again.", 
        type: "error" 
      });
      setSnackbarOpen(true);
    } finally {
      setLoading(false);
    }
  };

  // Reset form & close dialog
  const handleClose = () => {
    setFormData(initialFormState);
    setMessage({ text: "", type: "success" });
    onClose();
  };

  return (
    <Dialog open={open} onClose={handleClose}>
      <DialogTitle>
        Register
        <IconButton
          aria-label="close"
          onClick={handleClose}
          sx={{ position: "absolute", right: 8, top: 8, color: (theme) => theme.palette.grey[500] }}
        >
          <CloseIcon />
        </IconButton>
      </DialogTitle>
      <DialogContent>
        <TextField label="Username" name="username" fullWidth margin="dense" value={formData.username} onChange={handleChange} />
        {/* <TextField label="Password" name="password" type="password" fullWidth margin="dense" value={formData.password} onChange={handleChange} /> */}
        <TextField
  label="Password"
  name="password"
  type="password"
  fullWidth
  margin="dense"
  value={formData.password}
  onChange={handleChange}
  error={!!passwordError}
  helperText={passwordError}
/>

        <TextField select label="Role" name="role" value={formData.role} fullWidth margin="dense" onChange={handleChange}>
          <MenuItem value="BUYER">Buyer</MenuItem>
          <MenuItem value="ARTIST">Artist</MenuItem>
          <MenuItem value="ADMIN">Admin</MenuItem>
        </TextField>
      </DialogContent>
      <DialogActions>
        <Button onClick={handleClose} color="secondary">Cancel</Button>
        <Button onClick={handleSubmit} color="primary" variant="contained" disabled={loading}>
          {loading ? "Registering..." : "Sign Up"}
        </Button>
      </DialogActions>

      {/* Snackbar for feedback */}
      <Snackbar open={snackbarOpen} autoHideDuration={3000} onClose={() => setSnackbarOpen(false)}>
        <Alert onClose={() => setSnackbarOpen(false)} severity={message.type} sx={{ width: '100%' }}>
          {message.text}
        </Alert>
      </Snackbar>
    </Dialog>
  );
};

export default Register;
